import SelectLevelOfStoked from "./SelectLevelOfStoked.js"

export default function StokedLevel({ setStokedLevel,stokedLevel }) {
    const levelOfStokedArray = [
        {
            id: 1,
            stokedLevel: 'Tá flat bro'
        },
        {
            id: 2,
            stokedLevel: 'Dá pra bincar'
        },
        {
            id: 3,
            stokedLevel: 'Corre pra água!'
        }
    ];

    return (
        <>
            {levelOfStokedArray.map((level, index) => (
                <SelectLevelOfStoked
                    key={index}
                    id={level.id}
                    level={level.stokedLevel}
                    setStokedLevel={setStokedLevel}
                    stokedLevel={stokedLevel}
                />
            ))}
        </>
    )
}
